import React from "react";

const ProductTable = ({ products }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Image</th>
          <th>Price</th>
          <th>Options</th>
        </tr>
      </thead>
      <tbody>
        {products.map((product) => (
          <tr key={product.id}>
            <td>
              <img
                src={product.image}
                alt={product.name}
              />
            </td>
            <td>{product.price}</td>
            <td>
              <button>Edit</button>
              {/* Add other options or buttons here */}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ProductTable;
